import React from "react";

function Reeses() {
  return (
    <div>
      <h1>NOM NOM NOM</h1>
      <img
        src=""
        alt="Cartoon man eating lots of donuts."
      />
      <p>So tasty!</p>
    </div>
  );
}

export default Reeses;
